Codebase.onLoad(class{static barsRandomize(){document.querySelectorAll(".js-bar-randomize").forEach((e=>{e.addEventListener("click",(t=>{e.closest(".block").querySelectorAll(".progress-bar").forEach((e=>{let t=Math.floor(91*Math.random()+10),a=e.querySelector("span");e.style.width=t+"%",a&&(a.textContent=t+"%")}))}))}))}static init(){this.barsRandomize()}}.init());